import React, { useEffect, useState } from 'react';
import { useImages } from '../../context/ImageContext';
import { useAuth } from '../../context/AuthContext';
import Navbar from '../../components/common/Navbar';
import { getImageUrl } from '../../api/images';

const AdminDashboard = () => {
  const { user } = useAuth();
  const { 
    allImages, 
    loading, 
    error, 
    getAllImages, 
    deleteImage,
    getCacheStats
  } = useImages();
  
  // State for cache statistics
  const [cacheStats, setCacheStats] = useState(null);
  const [showCacheStats, setShowCacheStats] = useState(false);

  useEffect(() => {
    // Fetch all images when component mounts
    getAllImages();
  }, [getAllImages]);

  // Add state to track loading status of individual images
  const [imageLoadingStates, setImageLoadingStates] = useState({});

  

  const handleDelete = async (imageId) => {
    if (window.confirm('Are you sure you want to delete this image?')) {
      try {
        await deleteImage(imageId);
      } catch (err) {
        console.error('Failed to delete image:', err);
      }
    }
  };

  // Function to fetch and display cache statistics
  const handleViewCacheStats = async () => {
    try {
      const stats = await getCacheStats();
      setCacheStats(stats);
      setShowCacheStats(true);
    } catch (err) {
      console.error('Failed to fetch cache statistics:', err);
    }
  };

  return (
    <div>
      <Navbar />
      
      <div className="container">
        <div className="card">
          <h2>Admin Dashboard</h2>
          <p>Welcome, {user?.username}! You have admin privileges.</p>
          
          <div style={{ marginTop: '15px' }}>
            <button 
              className="btn btn-info" 
              onClick={handleViewCacheStats}
              style={{ marginRight: '10px' }}
            >
              View Cache Statistics
            </button>
          </div>
        </div>
        
        {/* Cache Statistics Modal */}
        {showCacheStats && cacheStats && (
          <div className="card" style={{ marginTop: '20px' }}>
            <h3>Cache Statistics</h3>
            <button 
              className="btn btn-sm btn-secondary" 
              style={{ position: 'absolute', top: '10px', right: '10px' }}
              onClick={() => setShowCacheStats(false)}
            >
              Close
            </button>
            
            <div style={{ marginTop: '15px' }}>
              <h4>Redis Cache</h4>
              <pre style={{ background: '#f5f5f5', padding: '10px', borderRadius: '5px' }}>
                {JSON.stringify(cacheStats.redis_cache, null, 2)}
              </pre>
              
              <h4>File Cache</h4>
              <pre style={{ background: '#f5f5f5', padding: '10px', borderRadius: '5px' }}>
                {JSON.stringify(cacheStats.file_cache, null, 2)}
              </pre>
            </div>
          </div>
        )}
        
        <h3 style={{ marginTop: '30px' }}>All Images</h3>
        
        {loading && (
          <div className="spinner"></div>
        )}
        
        {error && (
          <div className="alert alert-danger">{error}</div>
        )}
        
        {!loading && allImages.length === 0 && (
          <div className="card">
            <p>No images found in the system.</p>
          </div>
        )}
        
        <div className="image-grid">
          {allImages.map((image) => (
            <div key={image.id} className="image-card">
              {imageLoadingStates[image.id] ? (
                <div 
                  style={{ 
                    width: '100%', 
                    height: '200px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    backgroundColor: '#f0f0f0',
                    borderTopLeftRadius: '8px',
                    borderTopRightRadius: '8px'
                  }}
                >
                  <div className="spinner" style={{ width: '40px', height: '40px' }}></div>
                </div>
              ) : (
                <img 
                  src={getImageUrl(image.id)}
                  alt={`ID ${image.id}`}
                  style={{ 
                    width: '100%', 
                    height: '200px', 
                    objectFit: 'cover',
                    borderTopLeftRadius: '8px',
                    borderTopRightRadius: '8px'
                  }}
                  onError={(e) => {
                    console.log(`Image ${image.id} failed to load, using fallback...`);
                    // Set a fallback image or placeholder
                    e.target.src = 'data:image/svg+xml;charset=UTF-8,%3Csvg%20width%3D%22200%22%20height%3D%22200%22%20xmlns%3D%22http%3A%2F%2Fwww.w3.org%2F2000%2Fsvg%22%20viewBox%3D%220%200%20200%20200%22%20preserveAspectRatio%3D%22none%22%3E%3Cdefs%3E%3Cstyle%20type%3D%22text%2Fcss%22%3E%23holder_1890378dad7%20text%20%7B%20fill%3A%23999%3Bfont-weight%3Anormal%3Bfont-family%3AArial%2C%20Helvetica%2C%20Open%20Sans%2C%20sans-serif%2C%20monospace%3Bfont-size%3A10pt%20%7D%20%3C%2Fstyle%3E%3C%2Fdefs%3E%3Cg%20id%3D%22holder_1890378dad7%22%3E%3Crect%20width%3D%22200%22%20height%3D%22200%22%20fill%3D%22%23373940%22%3E%3C%2Frect%3E%3Cg%3E%3Ctext%20x%3D%2258.5%22%20y%3D%22104.8%22%3EImage%20Unavailable%3C%2Ftext%3E%3C%2Fg%3E%3C%2Fg%3E%3C%2Fsvg%3E';
                    // Prevent further error handling
                    e.target.onerror = null;
                  }}
                />
              )}
              
              <div className="image-info">
                <h3>Image #{image.id}</h3>
                <p>SHA256: {image.sha256_hash.substring(0, 10)}...</p>
                <p>IPFS CID: {image.ipfs_hash ? image.ipfs_hash.substring(0, 10) + '...' : 'N/A'}</p>
                <p>Uploaded by: User #{image.uploader}</p>
                <p>Uploaded: {new Date(image.uploaded_at).toLocaleString()}</p>
                <p>Deepfake: {image.deepfake_label} ({Math.round(image.deepfake_confidence * 100)}%)</p>
                
                
                  <button 
                    className="btn btn-danger" 
                    onClick={() => handleDelete(image.id)}
                  >
                    Delete
                  </button>
                </div>
              </div>
           
          ))}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
